import { useState } from 'react';
import './App.css';

import searchicon from './Assets/Search-icon.jpeg'
import clearicon from './Assets/Clear-icon1.jpeg'
// import cloudicon from './Assets/Cloud-icon.jpeg'
// import drizzleicon from './Assets/Drizzle-icon.jpeg'
// import rainicon from './Assets/Rain-icon.jpeg'
// import windicon from './Assets/Wind-icon.jpeg'
import snowicon from './Assets/Snow-icon1.jpeg'
// import huminityicon from './Assets/Huminity-icon.jpeg'

const WeatherDetails = ({icon, temp, city, country, lat, log})=>{
  return (
    <>
  <div className='image'>
   <img src={icon} alt='image' className='snow'/>
  </div>
  <div className='temp'>{temp} *C</div>
  <div className='location'>{city}</div>
  <div className='country'>{country}</div>
  <div className='cord'>
    <div className='div'>
      <span className='lan'>Latitude</span>
      <span>{lat}</span>
    </div>
    <div className='div'>
      <span className='log'>Logitude</span>
      <span>{log}</span>
    </div>
  </div>
  <div className='data-container'></div>
  </>
  );
};
function App() {
  const [icon, setIcon] = useState(snowicon); 
  const [temp, setTemp] = useState(0); 
  const [city, setCity] = useState("Chennai");
  const [country, setCountry] = useState("In");
  const [lat, setLat] = useState(0);
  const [log, setLog] = useState(0);

  return (
    <>
     <div className='container'>
      <div className='inpiut-container'>
        <input type='text' className='cityInput' placeholder='Search City'/>
        <div className='search-icon'>
          <img src={searchicon} alt='search'className='search'/>
        </div>
      </div>
      <WeatherDetails icon={icon} temp={temp} city={city} country={country}
      lat={lat} log={log}/>
     </div>
    </>

  );
}

export default App;
